export function fetchCustomers(token:string){
    return fetch('http://localhost:8080/admin/customers/all', {
                method: 'GET',
                headers: {
                  'Authorization': token,
                  'Content-Type': 'application/json',
                },
                mode: 'cors'
              })
                .then((res) => res.json())
                .then((data) => {
                  return data;
                })
                .catch((error) => {
                  console.log(error)
                });
}
